
import {View,Text,Image,TouchableOpacity,
	Pressable,TextInput,StyleSheet,StatusBar,SafeAreaView,ActivityIndicator} from 'react-native';
import AsyncStorage from '@react-native-async-storage/async-storage';
import Icon from 'react-native-vector-icons/MaterialCommunityIcons';
import Icon2 from 'react-native-vector-icons/Entypo'
import Icon3 from 'react-native-vector-icons/Fontisto';
import Navbar from '../components/Navbar';
import {useState,useEffect,useRef} from 'react';
import {LinearGradient} from 'react-native-linear-gradient'
import QRCode from 'react-native-qrcode-svg';

export default function AddScreen({
	navigation
}) {
	const [app,setApp] = useState('whatsapp');
	const [inputData,setInputData] = useState('');
	const [loading,setLoading] = useState(false);
	const linkRef = useRef();
	const [showOptions,setShowOptions] = useState(false);
	const apps = [
		{
			title:"linkedin",
		},
		{
			title:"whatsapp",
		},
		{
			title:"twitter",
		},
		{
			title:"instagram",
		},
		{
			title:"facebook",
		},
		{
			title:"telegram"
		},
		{
			title:"other",
		}
	]

	const colors = {
		'whatsapp':'bg-green-600',
		'twitter':'bg-[#1da1f2]',
		'linkedin':'bg-[#007bb5]',
		'facebook':'bg-[#0866ff]',
		'telegram':'bg-[#26a2e0]'


	}

	useEffect(()=>{
		const getData = async() => {
			const data = await AsyncStorage.getItem('QR-codes');
		}
		getData()
	},[])
	

	useEffect(()=>{
		if(app === 'instagram' || app === 'twitter' || app === 'facebook' || app === 'telegram'){
			setInputData('@')
		}else if(app === 'whatsapp'){
			setInputData('+91')
		}else{
			setInputData('')
		}


	},[app])

	useEffect(()=>{
  	if(app === 'instagram' || app === 'twitter' || app === 'facebook' || app === 'telegram'){
  		if(inputData?.length < 1){
  			setInputData("@")
  		}
  	}
	},[inputData])

	const saveQR = async() => {
		const data = await AsyncStorage.getItem('QR-codes');
		const newData = {
			app,inputData
		}
		console.log(data);
		if(data){
			let preData = JSON.parse(data);
			const preWithNewData = [...preData,newData];
			const jsonString = JSON.stringify(preWithNewData)
			await AsyncStorage.setItem('QR-codes',jsonString);
			setLoading(false);
			navigation.navigate('Home');
		}else{
			const preWithNewData = [newData];
			const jsonString = JSON.stringify(preWithNewData)
			await AsyncStorage.setItem('QR-codes',jsonString);
			setLoading(false);	
			navigation.navigate('Home');
		}

	}

	return (
		<SafeAreaView className="relative h-[100%]" >
			<StatusBar style="light" backgroundColor="green" />
			
			<View className="w-full flex px-3 py-3 items-center flex-row 
			gap-3">
				<TouchableOpacity onPress={()=>navigation.navigate('Home')} >
					<View className="bg-gray-100" >
						<Icon name="backburger" size={34} color="black"/>
					</View>
				</TouchableOpacity>
				<Text className="text-2xl font-semibold text-black">
					Create New
				</Text>
			</View>
			<View className="w-[95%] mx-auto mb-2 h-[1px] bg-gray-300"/>
			<View className="flex p-4">
				<View className="relative flex" >
				<View className={`flex -bottom-[100%] 
				${showOptions ? ' h-[100%] w-full' : 'h-[0%] w-[0%] overflow-hidden'} 
				absolute z-50 transition-all duration-200 ease-in-out`}>
					{
						apps?.map((app,j)=>(
							<Pressable key={j} onPress={()=>{
								setApp(app.title);
								setShowOptions(false)
							}} >
								<View className="bg-white border-b-[1px] border-solid border-gray-300 
								px-3 py-2 w-[100%] flex-row items-center" >
									{
										app.title === 'other' ?
										<Icon name='link-variant' size={28} color="black"/>
										:
										app.title === 'telegram' ?
										<Icon3 name={app?.title} size={28} color="black"/>
										:
										<Icon name={app?.title} size={28} color="black"/>
									}
									<Text className="text-lg capitalize ml-3 font-semibold text-black" >
										{app?.title}
									</Text>
								</View>
							</Pressable>
						))
					}
				</View>

				{
					app === 'instagram' ?
					<TouchableOpacity onPress={()=>{
						setShowOptions(!showOptions)
					}}>
						<LinearGradient colors={
							["#833ab4", "#fd1d1d", "#fcb045"]
						} className={`border-[1.4px] rounded-lg border-gray-300 border-solid 
						flex flex-row p-2 justify-between items-center `}>
							<View className="flex flex-row gap-2 items-center" >
								
									
								<Icon2 name="instagram" size={28} color="white"/>
								<Text className="text-xl font-semibold text-white">Instagram</Text>
									
								
							</View> 
							<Icon name="chevron-down" size={26} color="white"/>
						</LinearGradient>
					</TouchableOpacity>
					:
					app === 'other' ?
					<TouchableOpacity onPress={()=>{
						setShowOptions(!showOptions)
					}}>
						<View className={`border-[1.4px] rounded-lg border-gray-300 border-solid 
						flex flex-row p-2 justify-between items-center bg-white`}>
							<View className="flex flex-row gap-2 items-center" >
								
								<Icon name="link-variant" size={28} color="black"/>
								<Text className="text-xl font-semibold text-black">Others</Text>
									
							</View> 
							<Icon name="chevron-down" size={26} color="black"/>
						</View>
					</TouchableOpacity>
					:
					<TouchableOpacity onPress={()=>{
						setShowOptions(!showOptions)
					}}>
						<View className={`border-[1.4px] rounded-lg border-gray-300 border-solid 
						flex flex-row p-2 justify-between items-center ${colors[app]}`}>
							<View className="flex flex-row gap-2 items-center" >
								{
									app === 'telegram' ?
									<Icon3 name={app} size={28} color="white"/>
									:
									<Icon name={app} size={28} color="white"/>
								}
								<Text className="text-xl font-semibold text-white capitalize">{app}</Text>
									
							</View> 
							<Icon name="chevron-down" size={26} color="white"/>
						</View>
					</TouchableOpacity>
					
					


				}
				</View>

				<View className="mt-6">
					<View style={styles?.emailContainer}>
            	{
            		app === 'instagram' ? 
                <Text style={{color:"black",fontSize:20}} >
				 					Enter Your Instagram Name	                  		
                </Text>
              :
              app === 'whatsapp' ?
              <Text style={{color:"black",fontSize:20}} >
				 					Enter Your Whatsapp Number	                  		
                </Text>
              :
              app === 'linkedin' ?
              <Text style={{color:"black",fontSize:20}} >
									 Enter Your Linkedin Public URL Name	                  		
                </Text>
              :
              app === 'twitter'?
              <Text style={{color:"black",fontSize:20}} >
			 					Enter Your Twitter ID	                  		
              </Text>
              :
              app === 'facebook' ?
              <Text style={{color:"black",fontSize:20}} >
			 					Enter Facebook Username          		
              </Text>
              :
              app === 'telegram' ?
              <Text style={{color:"black",fontSize:20}} >
			 					Enter Telegram Username          		
              </Text>
              :
              <Text style={{color:"black",fontSize:20}} >
			 					Enter URL	                  		
              </Text>
            	}
              <View className="flex flex-row " >
              	  
                <TextInput style={styles?.emailInput}
	                placeholder={
	                	app === 'whatsapp' ? 'Whatsapp Number' : app === 'Twitter' ? 'Twitter ID' : app === 'linkedin' ? 'Linkedin Public URL Name' : app === 'instagram' ? 'Instagram ID' : app === 'facebook' ? 'Facebook Username' :'Enter URL starting with https://'
	                } 
	                placeholderTextColor="gray" 
	                className="w-full"
	                value={inputData} onChangeText={(text) => {
			          if(app === 'instagram' || app === 'twitter' || app === 'facebook'){
			          	if(text[0] !== '@'){
			          		setInputData('@'+text)
			          	}else{
			          		setInputData(text)
			          	}
			          }else if(app === 'whatsapp') {
			          	if(text[0] !== '+'){
			          		setInputData("+91" + text)
			          	}else{
			          		setInputData(text)
			          	}
			          }else{
			          	setInputData(text)
			          }
			        }}
	            />
          </View>
          <Pressable onPress={()=>{
          	if(!loading && inputData.length > 3){
          		setLoading(true);
          		saveQR();
          	}
          }} className={`w-full px-5 mt-3 ${loading ? 'py-1' : 'py-2'} 
          rounded-lg bg-blue-600 active:bg-blue-800 transition-all duration-200
          ease-in-out`}>
          	{
          		loading ?
          		<ActivityIndicator size="large" color="#fff" />
          		:
            	<Text className="text-center text-white text-xl font-semibold" >
              	Create QR Code
            	</Text>

          	}
          </Pressable>
          <View className="m-auto flex items-center mt-8" >
              <QRCode
              logo={{uri: 'data:image/png;base64,'}}
	      			logoSize={120}
              size={270}
		      		value={`${
				    		app === 'whatsapp'?
				    		'https://wa.me/'
				    		:
				    		app === 'twitter'?
				    		'https://twitter.com/'
				    		:
				    		app === 'linkedin'?
				    		'https://linkedin.com/in/'
				    		:
				    		app === 'instagram' ?
				    		'https://www.instagram.com/'
				    		:
				    		app === 'facebook' ?
				    		'https://facebook.com/'
				    		:
				    		app === 'telegram' ?
				    		'https://t.me/'
				    		:
				    		''
				    	}
				    	${
				    		app === 'instagram' || app === 'twitter' || app === 'facebook' ?
				    		inputData.slice(1)
				    		:
				    		inputData
				    	}`}
		   			 />
				    <Text id="link" ref={linkRef} className="mt-2 text-lg text-black" >
				    	{/*{
				    		app === 'whatsapp'?
				    		'https://wa.me/'
				    		:
				    		app === 'twitter'?
				    		'https://twitter.com/'
				    		:
				    		app === 'linkedin'?
				    		'https://linkedin.com/in/'
				    		:
				    		app === 'instagram' ?
				    		'https://www.instagram.com/'
				    		:
				    		app === 'facebook' ?
				    		'https://facebook.com/'
				    		:
				    		''
				    	}*/}
				    	{	
				    		inputData
				    	}
				    </Text>
				    <Text className="mt-5 text-3xl text-black font-semibold">
				    	Scan To Test
				    </Text>
			    </View>


        	</View>
				</View> 
				
			</View>


		</SafeAreaView>
	)
}


const styles = StyleSheet.create({
  
  emailContainer:{
    display:"flex",
    flexDirection:"column",
    gap:10,
    padding:'1%'
  },
  passContainer:{
    display:"flex",
    flexDirection:"column",
    gap:10
  },
  loginRegisterInput:{
    marginTop:34,
    display:'flex',
    flexDirection:"column",
    gap:30,
  },
  emailInput:{
    fontSize:18,
    borderBottomColor:'#a493df',
    borderBottomWidth:1,
    color:"black"
  },
});
